export class DeliveryType {
  constructor(id, deliveryType, minimumOrderQuantity, price, pricePerKilometre, eventProductOrders, product) {
    this.id = id;
    this.deliveryType = deliveryType;
    this.minimumOrderQuantity = minimumOrderQuantity;
    this.price = price;
    this.pricePerKilometre = pricePerKilometre;
    this.eventProductOrders = eventProductOrders;
    this.product = product;
  }
}
export function getDeliveryTypeIdentifier(deliveryType) {
  return deliveryType.id;
}
